import React from 'react'
import {MasterHeaderContainer} from "./master-header.styles";
import CategoryOverview from "../category-overview/category-overview.component";
import MasterSearch from "../master-search-service/master-search-service.component";
const MasterHeader = () => {
  return (
    <MasterHeaderContainer>
      <CategoryOverview/>
      <MasterSearch/>
    </MasterHeaderContainer>
  )
}

export default MasterHeader
